const Coin = ({rank, name, icon, price, symbol}) => {
  return (
    <div className="coin">
      
      <img src={icon} alt="coin" />
      <h2>{name}</h2>
      <p>${price.toFixed(2)}</p>
      <p>{symbol}</p>
    </div>
  )
}

export default Coin
